import React, { Component } from 'react';
import './App.css';

class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0
    }
  }

  render() {
    return (
      <div>
        {this.state.count}
      </div>
    );
  }
}


class App extends Component {

  render() {
    return (
      <div>
        <Counter />
      </div>
    );
  }
}

export default App;
